import React from 'react'
import { Link } from 'react-router-dom'

function ProductList({ products} ) {
  return (
    <div>
      <h2>Search Results</h2>
      <ul>
        {products.map((product) => (
          <li key={product.id}>
            <Link to={`/products/${product.id}`}>{product.name}</Link>
          </li>
        ))}
      </ul>
    </div>
  )
}

export default ProductList
